private static DetailAST findNextSibling(DetailAST ast, int tokenType) {
    DetailAST token = null;
    DetailAST node = ast.getNextSibling();
    while (node != null) {
        if (node.getType() == tokenType) {
            token = node;
            break;
        }
        node = node.getNextSibling();
    }
    return token;
}
